const initialState={

'':{
    CategoryName: '',
    img: '',
    name: '',
    type: '',
    price: 0
  }
}


 const PriceReducer=(State=initialState,action)=>{
    console.log(action.amount+10);
    switch (action.type) {
        case 'ADDTOCART':
            return Object.assign(State,{
                [action.name]:{
                    numOfItem:action.number,
                    totalPrice:parseInt(action.amount),
                    qty:action.qty,
                   name: [action.name]
                              }})
        
        
        default:return State
         
    }
}
export default PriceReducer
